import React, { useEffect, useState } from 'react'

function App() {

  const [json, setJson] = useState([{}]);

  useEffect = (() => {
    fetch("/json").then(response => response.json()).then(data => {setJson(data)});
  }, []);

  return (
    <div>
      <p> {json} </p>
    </div>
  )
}

export default App
